import React from 'react';
import { Grid, Header } from 'semantic-ui-react';

class Arm extends React.Component {
  render() {
    return (
      <Grid id="arm-page" container>
        <Header as="h1" textAlign="center">ARM</Header>
      </Grid>
    );
  };
}

export default Arm;
